import React from "react";

class Button extends React.Component {
  constructor(){
    super()
    this.handleClick = this.handleClick.bind(this);
  }
  handleClick() {
    console.log(this)
    console.log('Clicou!')
  }

  render() {
    return (
      <button onClick={this.handleClick}>Contador</button>
    )
  }
}

export default Button;
